import React, { useEffect, useState } from "react";
import MenuCard from "../menuCard/MenuCard";
import "./style.css";
import menuDetails from "./menuDetails.json";
import menuStates from "./menuStates.json";
import menuLikesDislikes from "./menuLikesDislikes.json";
import menuComments from "./menuComments.json";

export default function MenuCardList() {
  const [details, setDetails] = useState([]);
  const [states, setStates] = useState([]);
  const [likesDislikes, setLikesDislikes] = useState([]);
  const [comments, setComments] = useState([]);

  // 메뉴 초기 로딩
  useEffect(() => {
    setDetails(menuDetails);
    setStates(menuStates);
    setLikesDislikes(menuLikesDislikes);
    setComments(menuComments);
  }, []);

  return (
    <div className="menu_card_list">
      <MenuCard
        details={details[0]}
        initialState={states[0]?.state}
        bestComment={comments[0]?.bestComment}
        likes={likesDislikes[0]?.likes}
        dislikes={likesDislikes[0]?.dislikes}
      />
      <MenuCard
        details={details[1]}
        initialState={states[1]?.state}
        bestComment={comments[1]?.bestComment}
        likes={likesDislikes[1]?.likes}
        dislikes={likesDislikes[1]?.dislikes}
      />
      <MenuCard
        details={details[2]}
        initialState={states[2]?.state}
        bestComment={comments[2]?.bestComment}
        likes={likesDislikes[2]?.likes}
        dislikes={likesDislikes[2]?.dislikes}
      />
      <MenuCard
        details={details[3]}
        initialState={states[3]?.state}
        bestComment={comments[3]?.bestComment}
        likes={likesDislikes[3]?.likes}
        dislikes={likesDislikes[3]?.dislikes}
      />
      <MenuCard
        details={details[4]}
        initialState={states[4]?.state}
        bestComment={comments[4]?.bestComment}
        likes={likesDislikes[4]?.likes}
        dislikes={likesDislikes[4]?.dislikes}
      />
    </div>
  );
}
